post_content = "<h3>Need for Feed</h3>
<h3>Description</h3>
Need For Feed has been assisting communities and farmers since 2006.
Being a major supplier of emergency fodder and transportation, we are supplying animal feed needs to the affected farmers. We seek donations to help all farmers in fire, drought, and flood-affected areas rebuild their properties and livelihoods each year as needed.
<h3>Eligibility</h3>
Communities and farmers in need of fodder and their transportation.
<h3>How to apply</h3>
Call 459444111 or visit the web page <a style=\"text-decoration-line: underline; transition-duration: 0.3s; transition-timing-function: ease; color: #337ab7; outline: none; font-family: 'Open Sans', GlacialIndifference, sans-serif; font-size: 15px;\" href=\"https://www.needforfeed.org/apply-for-assistance.html/\">HERE</a>.
<figure>
											<a href=\"https://www.suicidecallbackservice.org.au/\" target=\"_blank\" rel=\"noopener\">
<img width=\"225\" height=\"225\" src=\"/wp-content/uploads/2021/08/2.png\" alt=\"\" loading=\"lazy\">								</a><figcaption></figcaption></figure>
<h4>Contact</h4>
<ul>
